import React from "react";
import "./AudioPlayer/styles/index.css";
import "./AudioPlayer/styles/customize-progress-bar.css";
import AudioPlayer from "react-audio";
import { tracks } from "./data/tracks";

function App() {
  return (
    <div className="App">
      <div style={{ width: 500 }}>
        <AudioPlayer
          displayTrack={true}
          progressBar={true}
          controls={true}
          tracks={tracks}
        />
      </div>
    </div>
  );
}

export default App;
